INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('SHATTERED-BACKBOARD', 'AIR JORDAN 1 RETRO HIGH OG BG ''SHATTERED BACKBOARD 3.0''', '2022-10-11 06:19:02.22', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665469140/fnyiwqsyktr237zamkn2.jpg,https://res.cloudinary.com/dehtovbpt/image/upload/v1665469140/lm8hpdyped8hozoprus8.jpg}', 250, 0, 20, 'Dropped in October 2019, the Nike Air Jordan 1 Retro High OG GS ''Shattered Backboard 3.0'' pays homage to the uniform Michael Jordan wore when he shattered the backboard glass during a 1985 Nike exhibition basketball game in Italy. The upper is informed by black and orange patent leather with a textured finish. An embossed Wings logo and Swooshes brand the design. The pale rubber cupsole nods to the shoe''s heritage.', 44, 'Black', '{3.5,4,4.5,5,5.5,6,6.5,7,7.5,8,8.5,9,9.5,10,10.5}', 2019, '575441 028', 500, 'KIDS', 'HIGH');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('Dark_Chocolate', 'Air Jordan 1 Mid SE ''Dark Chocolate''', '2022-10-11 03:10:00.129', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665457798/zqpg4piy9iabc91oxptl.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665457798/jlqesavm6ivbycnwnbfo.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665457798/gojez0jsd8pduoho8eq5.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665457798/azu0z5rltrvbghlt7dop.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665457798/ob4rprhhagzsod5jyij5.webp}', 200, 30, 12, 'The Air Jordan 1 Mid SE ‘Dark Chocolate’ features rustic earth tones on a classic silhouette modeled after the 1985 original. Soft black textile lines the interior of the upper, featuring a light brown nubuck base with a black leather Swoosh and suede overlays in chocolate brown. Reflective detailing lands on the heel and laces, good for enhanced visibility in low-light conditions. The mid-top rides on an Air-assisted rubber cupsole, highlighted by off-white sidewalls and a black rubber outsole.', 44, 'Dark Mocha', '{3,5,5.5,6,6.5,7,7.5,8,8.5,10,11,11.5,12,15,16,17,18}', 2021, 'DC7294 200', 13, 'MEN', 'MID');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('Homage', 'Wmns Air Jordan 1 Mid SE ''Homage''', '2022-10-11 02:42:25.9', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665456140/q1r5x5e2sjgkvp9mnc5w.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665456140/f28ooru57w5jvemmix1u.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665456140/rpaydp8matojlfojscpb.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665456141/qkrartq21yoquetrjft1.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665456141/ryxmqr2awbp9oqkklrpx.webp}', 120, 10, 15, 'The Women’s Air Jordan 1 Mid SE ‘Homage’ continues the split-color theme deployed on the ‘Homage to Home’ Jordan 1 High from 2018. The lateral side of the tumbled leather upper features a white base with contrasting black overlays, while the opposite side combines a black base with white overlays. Branding elements include a split Jumpman tongue tag and a printed Wings logo on the lateral collar flap. The mid-top is anchored by traditional cupsole tooling, highlighted by solid white sidewalls and a black rubber outsole.', 32, 'White', '{5,5.5,6,6.5,10,11,12}', 2022, 'DR0501 101', 45, 'WOMEN', 'MID');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('23-501', 'LEVI''S X AIR JORDAN 1 RETRO ''23/501 DENIM PACK''', '2022-10-11 06:07:14.412', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665468433/mm9eno1hlntx9jdxmkng.jpg,https://res.cloudinary.com/dehtovbpt/image/upload/v1665468433/y3bmi8jzslgcilbw7zgs.jpg,https://res.cloudinary.com/dehtovbpt/image/upload/v1665468433/bk2emp6yjse014d8yryf.jpg}', 1100, 0, 45, 'Limited to just 2,323 pairs, this 2008 collaboration between Levi’s and Jordan Brand also released with a pair of limited edition co-branded jeans and a t-shirt. The Levi’s x Air Jordan 1 Retro ‘23/501 Denim Pack’ puts a navy denim base on Michael Jordan''s first signature shoe, working a Varsity Red elephant print into the construction. The leather overlays add Varsity Red, while a subdued tan Swoosh matches the outsole.', 25, 'Varsity Red', '{9,9.5,10}', 2008, '332083 435', 300, 'MEN', 'MID');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('RetroBred1994', 'AIR JORDAN 1 RETRO ''BRED'' 1994', '2022-10-11 06:02:28.506', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665468146/gud2jlmk3ihun3rapz1f.jpg,https://res.cloudinary.com/dehtovbpt/image/upload/v1665468146/ghuoxbkhft1f5cyfan4j.jpg,https://res.cloudinary.com/dehtovbpt/image/upload/v1665468147/hswvlutityj5tzog356p.jpg,https://res.cloudinary.com/dehtovbpt/image/upload/v1665468147/si2q6jcj5en83wb4sx1z.jpg}', 2125, 0, 94, 'The Air Jordan 1 was brought back in 1994 with the launch of the Chicago-inspired black and red iteration that pays homage to Michael Jordan following his retirement, often referred to as "the shoe that began it all." The design features all-round premium leather, white rubber midsole and strong red outsole. Air Jordan logos on the lateral sides along with Nike Air logos on each tongue are signature branding details.', 2, 'Black Red', '{7.5,9,11,12}', 1994, '130207 061', 1, 'MEN', 'HIGH');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('UNC2018', 'Off-White x Air Jordan 1 Retro High OG ''UNC''', '2022-10-11 04:45:36.618', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665463534/yhqtnlzolbmlmkj1v1nx.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665463534/dvbj1ohwradvwy5dq4ix.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665463534/iefsmuuasqx5nlqizmjm.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665463534/x7q7outztlmhqxrpdf3d.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665463534/c6ygtosk0cvn2makbusx.webp}', 5625, 0, 54, 'Inspired by Michael Jordan’s alma mater, the Off-White x Air Jordan 1 Retro High OG ‘UNC’ carries a classic two-tone composition, filtered through Virgil Abloh’s unique design prism. The process involves taking a white leather base with dark powder blue overlays and adding embellishments that convey an expressive, handmade quality. They include detached Wings, a floating Swoosh, and lines of text on the medial-side quarter panel delineating the taxonomy of the shoe.', 1, 'University Blue', '{14,15,17}', 2018, 'AQ0818 148', 3, 'MEN', 'HIGH');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('OG-PS-Denim', 'Air Jordan 1 Retro High OG PS ''Denim''', '2022-10-11 04:54:51.26', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665464089/srwprsmmv92uhrfm869t.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665464090/mxjp7hut5f4wnijpwmjy.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665464090/nruivzqqiiutdf05iplw.webp}', 77, 0, 22, 'Built for little kids, the Air Jordan 1 Retro High OG PS ‘Denim’ makes over the legacy silhouette with updated materials drawn from the world of American workwear. The high-top is outfitted in white tumbled leather with washed denim overlays, featuring a faded indigo finish with raw, frayed edges. A woven Nike tag graces the denim tongue, while a screen-printed Wings logo decorates the lateral collar flap. Underpinning the mid-top is a traditional cupsole that pairs white sidewalls with a Boarder Blue rubber outsole.', 0, 'Denim', '{1,1.5,2,2.5}', 2022, 'CU0449 104', 60, 'BABY', 'HIGH');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('OG-Chicago', 'Off-White x Air Jordan 1 Retro High OG ''Chicago'' Sample', '2022-10-11 04:34:33.928', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665462872/rtq8gu8ycznf4li3htes.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665462872/vufuxtiw3almlykhw7wn.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665462872/c0wi0ed9mikw3ghhebg2.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665462872/ctpbi4tzsvfa5zgjbf6u.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665462872/kvpxdnwm6mhwbe1ulur6.webp}', 0, 0, 0, 'Sample', 0, 'Varsity Red', '{3.5,4,4.5,5,19,19.5,20}', 2017, 'AA3834 101', 23, 'UNISEX', 'HIGH');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('PS-Reverse-Mocha', 'Travis Scott x Air Jordan 1 Low OG PS ''Reverse Mocha''', '2022-10-11 04:58:26.496', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665464304/ofhk9u0ljsktx0dljhif.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665464304/bjrcp1vn6ctinfpsr6gk.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665464304/tuj4znv2rxa5cejelk7t.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665464305/bzl3ccl6ptrmnedeihxi.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665464305/qk8cnejypoig3ryvekgd.webp}', 455, 200, 100, 'Made for little kids, the Travis Scott x Air Jordan 1 Low OG PS ‘Reverse Mocha’ presents a color-flipped rendition of the Houston rapper’s original ‘Mocha’ Jordan 1 Low from 2019. The upper is crafted from brown nubuck with off-white leather overlays and an oversized reverse Swoosh on the lateral side. A woven Nike Air tag — along with an off-center Cactus Jack label — adorns the tongue, while crimson embroidery on each heel tab displays Travis Scott’s face graphic on left shoe and the Jordan Wings logo on the right. An aged finish distinguishes the midsole, reinforced underfoot by a grippy brown rubber outsole.', 0, 'Brown', '{1,1.5,2,2.5,13,13.5}', 2022, 'DO5442 162', 101, 'BABY', 'LOW');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('Bred_Toe', 'Air Jordan 1 Mid ''Bred Toe''', '2022-10-11 02:48:32.76', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665456511/pzatibtricgkra7frynd.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665456511/n8octtemrvqegp827yvb.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665456511/o2pdqfwecco6c9fmlbqk.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665456511/lahdqrwgfsw5nwefi8ze.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665456511/mz1eaheexufra1n9jfyy.webp}', 750, 0, 0, 'The Air Jordan 1 Mid ‘Bred Toe’ showcases a familiar Chicago-inspired color scheme. The smooth leather upper combines white quarter panels with contrasting black overlays at the forefoot and heel. Fire Red accents settle on the perforated toe box, mid-cut collar and signature Swoosh. A woven Jumpman tag graces the crimson nylon tongue, while a retro Wings logo is debossed on the lateral collar flap. The rubber cupsole is faithful to the original 1985 design, highlighted by an Air-sole heel unit encapsulated in lightweight polyurethane.', 0, 'Fire Red', '{3,5,5.5,6,6.5,7,7.5,8,10,11,12,15,16,17}', 2022, '554724 079', 45, 'MEN', 'MID');
INSERT INTO "products" ("id", "title", "dateAdded", "mediaURLs", "price", "discount", "shippingCost", "details", "salesCount", "color", "sizes", "year", "sku", "stockQty", "gender", "type") VALUES ('Black_Gym_Red', 'Air Jordan 1 Retro High OG ''Black Gym Red''', '2022-10-11 04:29:03.809', '{https://res.cloudinary.com/dehtovbpt/image/upload/v1665462542/ke3cpjzx8g47xz6r8q6x.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665462542/zltaoutszffm9um4gzx6.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665462542/igd3scywrbybuv9sf4gd.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665462542/aii8yvvsqzfbpkncybdw.webp,https://res.cloudinary.com/dehtovbpt/image/upload/v1665462542/uvjzgtaptah9tb9bedjp.webp}', 215, 40, 0, 'Featuring chromed-out leather overlays and hits of Gym Red, the Air Jordan 1 Retro High OG ''Black Gym Red'' remakes the shoe that started it all with can''t-miss detail. Released in early January 2020 along with other AJ1 colorways, this version stays true to the original construction. High and low support overlays anchor the laces, a perforated toe box creates ventilated comfort, and durable rubber traction is a reminder of why it changed the game in 1985.', 0, 'Black', '{7,7.5,8,8.5,14,16,18}', 2020, '555088 060', 3, 'UNISEX', 'HIGH');
